import React, { Fragment } from 'react';
import { withRouter } from 'react-router';
import styled from 'styled-components';

const BackButton = styled.a`
	font-family: 'cera_proregular';
	color: #00aaf4;
	font-size: 20px;
	cursor: pointer;
	text-decoration: none;
	position: absolute;
	left: 38px;
	top: 68px;
	z-index: 3;

	&.hidden {
		display: none;
	}
`;


const backButton = (props) => {
	return (
		<Fragment>
			<BackButton className={props.status} onClick={() => props.history.go(-1)}>
				<img src="assets/images/back-arrow.png" alt="back-arrow" /> back
			</BackButton>
		</Fragment>
	)
};


export default withRouter(backButton);
